import React from 'react';
import './marqueue.css';  // Importing the Marqueue styles

const Marqueue = ({ text }) => {
  return (
    <div className="marqueue-container">
      <div className="marqueue-text">
        {text}
      </div>
    </div>
  );
}

export default Marqueue;
